import React from 'react';

function Results(props) {
    return (
        <div className="container">
            <img src={props.imageLinks} />
            <h3>{props.title}</h3>
            <h3>{props.author}</h3>
            <p>{props.description}</p>
        </div>
    )
};

export default Results;
